import React from 'react';
import './Product.css';



function Product({header, image, price}) {
  const imagePath = "../images/el1.png";
  return (
    <div className="Product">
      <img src={imagePath} />
      <h1>{header}</h1>
      <p>{` ${price} руб. `}</p>
      <button>В корзину</button>
    </div>
  );
}

export default Product;
